&lt;b&gt;.:: S T O R Y ::.&lt;/b&gt;
Nine Souls opens with perhaps the most memorable opening sequence in recent memory. The camera swoops over Tokyo, showing the city full of life until, suddenly, single buildings start to blacken, blur and disappear. Soon this infection takes over the entire city, rendering it a browned wasteland, bar the TV tower in the centre of the metropolis.

In a tower close to the TV transmitter, a young man, later to be revealed as Michiru Kaneko, is cradling a knife, listening to his family arguing about money. There's a feeling that something is about to happen, though at this stage in the movie all the violence is implicit. We next see Kaneko being delivered to a cell Ã¢â‚¬â€œ which we're told is the least crowded in the entire jail, although there's nine in there already. Everything is grey, drab, institutional. There's no welcome from Kaneko's fellow inmates either, other than a few words from Yamamoto, a master forger, who is assigned by one of the guards to look after the fresh detainee. He's also the guy in charge. Just moments later, though, Yamamoto finds a hair in his soup and goes mental, baiting the guards, whilst at the same time revealing the location of a secret stash of counterfeit currency, before being bundled out by the warders. In the chaos that ensues, a mouse and mousehole is spotted by little person Shiratori Ã¢â‚¬â€œ escape is possible. So all nine climb out into unexpected freedom Ã¢â‚¬â€œ and cue Toyoda's trademark slo-mo title sequence with loud rock music.

